import './App.css';
import {
  BrowserRouter,
  Routes,
  Route } from 'react-router-dom';
import { ReactDO } from 'react';

function App() {
  const name = 'Gracjan';
  const element = <h1>Witaj, {name}</h1>;
  ReactDOM.render(
    element,
    document.getElementById('root')
  );
}

export default App;
